import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App" sty>
      <form>
        <input type="text" label="name"/>
        <input type="password" label="password"/>
     <button>Login</button>
     </form>
    </div>
  );
}

export default App;
